import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { useParams } from 'react-router-dom';
import { useEffect, useState } from 'react';
import { findingOne } from './API';
export const Read=()=>{
    const{id}=useParams()
    const[corp,setCorp]=useState({})

    const callFindOne=async()=>{
        const t = await findingOne(id)
        setCorp(t.data)
    }

    useEffect(()=>{
        callFindOne()
    },[])

    return(
        <>
            <Card sx={{ minWidth: 275 }}>
                <CardContent>
                    <Typography sx={{ fontSize: 30 }} color="text.primary" gutterBottom>
                        {corp.org}
                    </Typography>
                    <Typography variant="h5" component="div">
                        {corp.nature}   {corp.employees}
                    </Typography>
                    <Typography sx={{ mb: 1.5 }} color="text.error">
                        {corp.opennings}
                    </Typography>
                    <Typography variant="body2">
                        {corp.place}    {corp.basic}
                    <br />
                        {corp.ratings}
                    </Typography>
                </CardContent>
                <CardActions>
                    <Button size="medium" color='error'>Delete</Button>
                    <Button size="medium" color='warning'>Edit</Button>
                </CardActions>
                </Card>
        </>
    )
}
